SET SERVEROUTPUT ON
CREATE OR REPLACE TRIGGER tartozas_add
AFTER INSERT ON vizsgazik
FOR EACH ROW
BEGIN

DBMS_OUTPUT.PUT_LINE(:NEW.vizsgaalkalom);
IF (:NEW.vizsgaalkalom) = 3 THEN
    UPDATE tartozas SET tartozasosszeg = tartozasosszeg + 1500 WHERE tartozas.hallgatoAzonosito = :NEW.hallgatoAzonosito;
    END IF;
END;




